import styles from '../styles/Home.module.css'
import { Github } from 'react-icons/fa'
import { Linkedin } from 'react-icons/fa';

export default function Icons() {
    return (
        <div className={styles.icons}>
            <div>
                <Github />
            </div>
            <div>
                <Linkedin />
            </div>
        </div>
    )
}
